      if(mode === 'darkMode'){
        mode = ''
      }else{
        mode = 'darkMode'
      }
  }

function NavBar(){
    return(
        <div className="navBar">
            <h1>Kenneth Schaefer</h1>
            <nav>
                <Theme />
